import React from 'react';
import PropTypes from 'prop-types';
import styles from './Nav.module.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {BrowserRouter as Router, Link, Route, Switch} from "react-router-dom";
import Form from "../Form/Form";
import Filter from "../Filter/Filter";
import List from "../List/List";

class Nav extends React.Component{
    render(){
        return (
            <Router>
                <nav className="navbar navbar-expand-sm navbar-dark bg-dark">
                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarsExample03"
                            aria-controls="navbarsExample03" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>

                    <div className="collapse navbar-collapse" id="navbarsExample03">
                        <ul className="navbar-nav mr-auto">
                            <li className="nav-item active">
                                <Link className="nav-link" to="/polevky">Polévky</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link" to="/hlavni">Hlavní chody</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link" to="/dezerty">Dezerty</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link" to="/novy">Vytvořit nový</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link" to="/seznam">Seznam</Link>
                            </li>
                        </ul>
                    </div>
                </nav>

                <div className="container mt-5">
                    <Switch>
                        <Route path="/polevky" component={List} />
                        <Route path="/hlavni" component={List} />
                        <Route path="/novy" component={Form} />
                        <Route path="/seznam" component={Filter} />
                    </Switch>
                </div>
            </Router>
        );
    }
}

export default Nav;
